import React, { useEffect } from "react";
import scrapeIt from "scrape-it";

const News = () => {
  useEffect(() => {
    scrapeIt(
      "https://www.google.com/search?q=ah&sxsrf=AOaemvJKdrHH5p71-1icYESDPmOeWtsEeA%3A1638199584445&source=hp&ei=IPGkYcXAGK-J4-EPqqqM8A0&iflsig=ALs-wAMAAAAAYaT_MGo0qQfR20uF7625at3SGuayUe_4&ved=0ahUKEwjF0LKC8b30AhWvxDgGHSoVA94Q4dUDCAc&uact=5&oq=ah&gs_lcp=Cgdnd3Mtd2l6EAMyBAgjECcyBAgjECcyBQgAEIAEMgUIABCABDIFCAAQgAQyCAguEIAEELEDMggIABCABBCxAzIICC4QgAQQsQMyCwguEIAEELEDEIMBMgUILhCABDoHCCMQ6gIQJzoGCCMQJxATOgsILhCABBDHARCjAjoICAAQsQMQgwE6DgguEIAEELEDEMcBEKMCOhEILhCABBCxAxCDARDHARDRA1CxF1jPF2DnGmgCcAB4AIAB5AGIAbUDkgEDMi0ymAEAoAEBsAEK&sclient=gws-wiz",
      {
        // title: " h3",
        // desc: ".header h2",
        // avatar: {
        //   selector: ".header img",
        //   attr: "src",
        // },

        articles: {
          listItem: ".article",
          data: {
            // Get the article date and convert it into a Date object
            createdAt: {
              selector: ".date",
              convert: (x) => new Date(x),
            },

            // Get the title
            title: "a.article-title",

            // Nested list
            tags: {
              listItem: ".tags > span",
            },

            // Get the content
            content: {
              selector: ".article-content",
              how: "html",
            },

            // Get attribute value of root listItem by omitting the selector
            classes: {
              attr: "class",
            },
          },
        },
      }
    )
      .then(({ data, response }) => {
        console.log(`Status Code: ${response.statusCode}`);
        console.log(data);
      })
      .catch((err) => console.log("err", err));
    console.log("useefffec");
  }, []);

  return <div></div>;
};

export default News;
